import './App.css';
import Appbar from './components/Appbar';
import { useParams } from 'react-router-dom';
import Paper from '@mui/material/Paper';
import React, { useEffect, useState } from 'react';


function Result() {
  const { id, dep } = useParams();

  const myStyle = {
    backgroundColor: "#eb8934",
    backgroundSize: 'cover',
    minHeight: "100vh",
    backgroundRepeat: 'repeat',
  };

  const [data, setData] = useState();

  useEffect(() => {
    if (id && dep){
        fetch(`http://localhost:8080/api/v1/data/${dep}/id/${id}`)
  .then(response => response.json())
  .then(datar => {
    setData(datar);
  })
  .catch(error => {
    console.error('Error fetching data:', error);
  });
    }
}, [dep, id, setData]);

  return (
    <div className="App" style={myStyle}>
      <Appbar />
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <p>Author: {data.author}</p>
      <p>Description: {data.description}</p>
      <p>Setup: {data.setup}</p>
      <p>Funcover: {data.funcover}</p>
      <p>Subdep: {data.subdep}</p>
      <p>Coll: {data.coll}</p>
      <p>ID: {data.id}</p>
      <p>Created Date: {data.date_Cr}</p>
      <p>Modified Date: {data.date_Md}</p>
    </>
  )}
      </Paper>
    </div>
  );
}

export default Result;
